    false,nt"url": null,nt"notes": "This annual narrative report for Lacreek
    National Wildlife Refuge outlines Refuge accomplishments during the 1990 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    public participation and compliance with environmental mandates. Refuge administration
    is outlined; information about personnel, youth programs, other manpower programs,
    volunteer programs, funding, safety, and technical assistance is given. Habitat
    management is also covered; subjects include wetlands, forests, croplands, grasslands,
    other habitats, grazing, haying, fire management, pest control, and water rights.
    The wildlife section of the report discusses wildlife diversity, endangered and
    threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
    other migratory birds, game mammals, other resident wildlife, fisheries resources,
    wildlife propagation and stocking, surplus animal disposal, scientific collections,
    animal control, marking and bird banding, and disease prevention and control. The
    public uses of the Refuge described in this report include outdoor classrooms, interpretive
    programs, hunting, fishing, trapping, wildlife observation, other wildlife oriented
    recreation, camping, picnicking, other non-wildlife oriented recreation, and law
    enforcement. The equipment and facilities section of the report provides information
    about new construction, rehabilitation, major maintenance, equipment utilization
    and replacement, communication systems, and computer systems. Cooperative programs
    and items of interest are provided at the end. Refuge brochures and field guides
    are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
